import React from 'react';
import './WelcomePage.css';
import { useNavigate } from 'react-router-dom';
import logo1 from '../assets/companies/microsoft-logo.png';
import logo2 from '../assets/companies/deloitte-logo.png';
import logo3 from '../assets/companies/etisalat-logo.png';
import logo4 from '../assets/companies/siemens-logo.png';
import logo5 from '../assets/companies/pwc-logo.png';

const WelcomePage = () => {
  const navigate = useNavigate();

  return (
    <div className="welcome-container">
      <div className="welcome-overlay">
        <header className="welcome-header">
          <h1 className="welcome-title">Empowering Students. Connecting Companies.</h1>
          <p className="welcome-subtitle">Launch your career with exclusive internship opportunities tailored to you.</p>
          <div className="welcome-buttons">
            <button onClick={() => navigate('/login')} className="welcome-btn login">Student Login</button>
            <button onClick={() => navigate('/signup')} className="welcome-btn signup">Company Sign Up</button>
          </div>
        </header>

        <div className="company-tape">
          <div className="tape-track">
            {[logo1, logo2, logo3, logo4, logo5, logo1, logo2, logo3, logo4, logo5].map((logo, index) => (
              <img key={index} src={logo} alt={`Company ${index + 1}`} className="tape-logo" />
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default WelcomePage;
